import Item from './Item';
import { Event } from '../models/event';

interface Props {
    events: Array<Event>;
    id: number;
    description: string;
    date: string;
    onDelete:(id: number) => void;
    searchList: Array<Event>;
}

const Events: React.FC<Props> = ({events, onDelete, searchList}) => {

    if(searchList.length>0) {
        const eventList = searchList;
    } else {
        const eventList = events;
    }

    return (
        <>
        <h1>Event list: </h1>
        <ul>

            {events?.map((event, index) => (
                <Item 
                    key={event.id}
                    id={event.id}
                    description={event.description}
                    date={event.date} 
                    events={[]}
                    onDelete={onDelete}        
                />  
            ))}

        </ul>
        </>
    )
}


export default Events
